import React from "react";

export default function Phonetics(props) {
  return (
    <div className='phonetics'>
      {props.audios.map(function (audio, index) {
        return (
          <a
            rel='noreferrer'
            href={props.audios[0].audio}
            target='_blank'
            key={index}>
            Listen
          </a>
        );
      })}
    </div>
  );
}
